  return (
    <React.StrictMode>
      <div>
        <Navbar2 />
        <Navbar />
        <Slider />
        <h1 className="date-left">.......</h1>
        <NewsCategory category={"sports"} />
        <NewsCategory category={"entertainment"} />
        <NewsCategory category={"health"} />
        <h1 className="date-left">......</h1>
        <Footer />
      </div>
    </React.StrictMode>
  );
};

